import connkat from "./images/connkat.png";
import "./App.css";

function Nav() {
  return (
    <div className="Nav">
      <div className="Link">
        <a href="./images/connkat-resume.pdf" download="connkat-resume">
          Download Resume
        </a>

        <a href="/images/myw3schoolsimage.jpg" download>
  <img src="/images/myw3schoolsimage.jpg" alt="W3Schools" width="104" height="142" />
</a>

      </div>
      <div className="Nav-logo">
        <img src={connkat} className="Nav-logo" alt="Nav-logo" />
      </div>
      <div className="Link">
        <a href="mailto:hi.connkat@gmail.com" target="_blank" rel="noreferrer">
          Get in Touch
        </a>
      </div>
    </div>
  );
}

export default Nav;
